import React from 'react';

function Rating({ question, onAnswer }) {
  return (
    <div className="rating">
      <p>{question}</p>
      {[1, 2, 3, 4, 5].map((rating) => (
        <button key={rating} onClick={() => onAnswer(rating)}>
          {rating}
        </button>
      ))}
    </div>
  );
}

export default Rating;
